import '../App.css';
import { Routes, Route } from "react-router-dom";
import FrontPage from './FrontPage';


function App() {

  return (
    <div>

    <Routes>
      <div className="main"></div>
      <Route path="/" element={<FrontPage />}/>

    </Routes>

  </div>
  );
}

export default App
